    'IC100EX' => array(
        'icNumber' => 'IC100EX',
        'number' => 'IC100EX',
        'name' => 'Joyetech - Exceed D19 - E-Zigarette - by InnoCigs',
        'commonName' => 'Exceed D19',
        'type' => 'E_CIGARETTE',
        'category' => 'E-ZIGARETTEN',
        'supplier' => 'Joyetech',
