        'base' => null,
        'description' => '<p>Das Eleaf iStick Pico 21700 E-Zigaretten Set besteht aus dem iStick Pico 21700 Akkuträger mit einer maximalen Ausgangsleistung von 100 Watt und dem Eleaf ELLO Clearomizer mit einem Füllvolumen von 4 ml, der für das DL-Dampfen, also das Inhalieren direkt in die Lunge - auch Dampfen im subohmen Bereich genannt - konzipiert ist. Anders als der Vorgänger iStick Pico kann der Eleaf iStick Pico 21700 Akkuträger sowohl mit einer 18650er als auch mit einer 21700er Akkuzelle betrieben werden.</p>
<p>Der iStick Pico 21700 Akkuträger wird über die Feuertaste und zwei weiteren Tasten an der Unterseite des Gehäuses gesteuert. Alle Einstellungen und weiteren Parameter werden Ihnen auf dem im Gehäuse integrierten OLED-Display angezeigt. Es stehen 4 Betriebsmodi zur Verfügung: der VW-Modus (Variable Wattage), bei dem Sie die Leistung auf einen festen Wert zwischen 1 und 100 Watt einstellen können, der ebenfalls leistungsgeregelte Bypass-Modus, bei dem die Leistungsabgabe mit dem Ladestand der Akkuzelle korreliert und die beiden temperaturgesteuerten Modi TC und TCR, bei denen Sie zwischen 100 und 315 °C bestimmen, bis zu welcher Temperatur der Coil (Verdampferkopf) erhitzt werden soll. Unterstützt werden Coils mit Drähten aus Nickel, Titan und Edelstahl. Der Akkuträger kann über das mitgelieferte USB-Kabel mit einem PC oder Laptop verbunden werden, um aktuelle Software-Updates für den iStick Pico 21700 zu erhalten.</p>
<p>Der ELLO Clearomizer hat ein Tankvolumen für 4 ml Liquid, das Sie durch das integrierte Top-Filling-System bequem von oben in den Clearomizer einfüllen können, ohne ihn vom Akkuträger abschrauben zu müssen. Durch den stufenlos regelbaren Airflow Control bestimmen Sie den Zugwiderstand. Im Lieferumfang enthalten sind 2 Verdampferköpfe (Heads) für das DL-Dampfen: der HW2 Dual-Cylinder Head mit 0,3 Ohm ist vorinstalliert, der HW1 Single-Cylinder Head mit 0,25 Ohm ist beigepackt.</p>
<p>Das E-Zigaretten Set wird durch eine 21700er oder eine 18650er Akkuzelle betrieben, die nicht im Lieferumfang enthalten ist.</p>
