        'description' => '<p>Das Eleaf iStick MELO E-Zigaretten Set setzt sich zusammen aus dem iStick Melo Akku mit einer maximalen Kapazität von 4.400 mAh und dem MELO 4 D22 Clearomizer mit 2 ml Füllvolumen. Dank ihres kompaktes Designs liegt diese E-Zigarette gut in der Hand.</p>
<p>Der iStick MELO hat einen fest eingebauten Akku mit einer maximalen Kapazität von 4.400 mAh womit eine maximale Ausgangsleistung von 60 Watt möglich ist. Auf der Oberseite des Gehäuse befinden sich ein 0,49 Zoll Display und 2 Tasten. Zusammen mit der Feuertaste können Sie hierüber die verschiedenen Betriebsmodi des iStick MELO Akkus einstellen und kontrollieren. Sie können wählen zwischen dem leistungsgeregelten VW-Modus (Variable Watt), dem Bypass-Modus, der einen ungeregelten Akku simuliert und dem temperaturgeregelten TC-Modus, bei dem Sie die Temperatur wählen, bis zu der die Wicklung im Verdampferkopf maximal erhitzt wird. Über das mitgelieferte QC-USB-Kabel können Sie den Akku mit 2A Ladestrom schnell wieder aufladen.</p>
<p>Der MELO 4 D22 Clearomizer hat ein Tankvolumen von 2 ml. Wie bei den meisten Clearomizern von Eleaf wird auch bei diesem das Liquid bequem über Top-Filling von oben eingefüllt. Der Clearomizer muss beim Befüllen also nicht vom Akku entfernt werden. Mit einem Ring am unteren Rand des Clearomizers stellen Sie stufenlos den Zugwiderstand mit dem Airflow-Control ein. Mitgeliefert werden zwei Verdampferköpfe (Heads), die beide für das subohme Dampfen konzipiert sind, also für die direkte Lungeninhalation (DL). Ein EC2 Head<span data-mce-mark="1"> mit 0,3 Ohm, für den sich ein Leistungsbereich zwischen 30 und 80 Watt empfiehlt und ein EC2 Head mit 0,5 Ohm, der zwischen 30 und 100 Watt betrieben wird. </span></p>
