        'base' => null,
        'description' => '<p>Die Aspire Nautilus AIO E-Zigarette ist ein schickes Pod-System. Verdampfer und Akku bilden bei Pod-Systemen optisch eine Einheit. AIO steht für all-in-one. Gemeint ist, dass Sie außer einem E-Liquid alles bekommen, was Sie brauchen, um mit der E-Zigarette loszulegen.</p>
<p>Die Nautilus AIO hat ein angenehm unaufdringliches wertiges Design. Das Gerät liegt gut in der Hand. Optisch und haptisch entsteht der Eindruck hoher Verarbeitungsqualität. Das einzige Bedienelement im Betrieb ist der Feuerknopf. Durch fünfmaliges Klicken schalten Sie das Gerät ein oder aus. Halten Sie beim Ziehen den Feuerknopf gedrückt, um Dampf zu erzeugen. Das Mundstück der Aspire Nautilus AIO ist durch eine abziehbare Kappe gut gegen Staub und Schmutz geschützt.</p>
<h2><strong>Nautilus AIO Pod</strong></h2>
<p>Die Aspire Nautilus AIO arbeitet mit den gleichen Verdampferköpfen wie der inzwischen schon fast legendäre Aspire Nautilus Verdampfer. Anders als bei einigen anderen Pod-Systemen kann der Verdampferkopf einzeln gewechselt werden. Sie müssen also nicht das gesamte Pod wegwerfen und ersetzen, wenn der Verdampferkopf verbraucht ist, sondern setzen einfach einen neuen Kopf ein.</p>
<p>Die beliebten Aspire Nautilus BVC Verdampferköpfe zählen zu den Köpfen mit der besten Geschmacksentwicklung im MTL-Bereich. MTL (Mouth-To-Lung) bezeichnet die Zugtechnik, bei der - wie bei einer Zigarette - der Dampf zunächst in den Mund gezogen und dann aus dem Mund in die Lunge inhaliert wird. Im Lieferumfang sind zwei 1,8 Ohm BVC Verdampferköpfe enthalten. Einer davon ist für die Verwendung mit Nikotinsalz-Liquids optimiert.&nbsp;</p>
<p>Neben den 1,8 Ohm Köpfen können Sie mit dem Nautilus AIO auch Aspire BVC Köpfe mit anderem Widerstand verwenden. Dieser sollte aber nicht unter 1,2 Ohm liegen, da der Akku des Nautilus AIO dafür nicht ausgelegt ist und die korrekte Funktion des Geräts beeinträchtigt würde.</p>
<p>Der Pod des Nautilus AIO fasst üppige 4,5 ml E-Liquid. Damit dürften Sie bequem durch den Tag kommen. Sie lösen den Pod vom Akku, indem Sie die Verriegelung durch Druck auf zwei sich an den Seiten gegenüberliegenden Tasten lösen. Danach kann der Pod vom Akku gezogen werden.</p>
<p>Auf der Unterseite des Pods befindet sich die Einfüllöffnung für E-Liquid. Sie ist mit einem Silikonstopfen verschlossen, der das Auslaufen verhindert. Die Einfüllöffnung ist mit 4,6 mm Durchmesser so großzügig ausgelegt, dass Sie den Pod auch aus Liquidflaschen mit breiter Spitze bequem befüllen können.</p>
<p>Wenn Sie gerade einen neuen Kopf eingesetzt haben, sollten Sie nach der Erstbefüllung ein paar Minuten warten, bevor Sie den ersten Zug nehmen. Neue Köpfe brauchen diese Zeit, damit sich die Keramik oder Watte, die die Heizspule umgibt, mit Liquid vollsaugen kann. Bei den Aspire BVC Heads sind zwei bis drei Minuten Wartezeit ausreichend.</p>
<p>Auf der Unterseite des Pods finden Sie ebenfalls den Schraubverschluss, mit dem der Verdampferkopf am Pod befestigt wird. Integriert in diesen Verschlussmechanismus ist auch die Regelung der Luftzufuhr (AFC, Air Flow Control). Auch bei maximal eingestellter Luftzufuhr bleibt bei der Aspire AIO ein deutlicher Zugwiderstand, so wie sich das für ein MTL-System gehört.&nbsp;</p>
<h2><strong>Nautilus AIO Akku</strong></h2>
<p>Der Akku der Aspire AIO ist fest verbaut und verfügt über eine Kapazität von 1.000 mAh. Damit sollten Sie in der Regel gut über den Tag kommen. Aufgeladen wird die E-Zigarette über einen setilich am Gerät befindlichen Micro-USB Anschluss. Der Ladestrom beträgt 1 Ampere. Damit ist der Akku bereits nach einer halben Stunde Ladezeit wieder ausreichend geladen. Das vollständige Aufladen des leeren Akkus dauert ungefähr zwei Stunden.</p>
<p>Während des Betriebs und während des Aufladens zeigt die Nautilus AIO Ihnen den Ladestand des Akkus über einen LED-Indikator, der im Feuerknopf integriert ist, in drei Stufen an. Das Gerät ist mit Funktionen ausgestattet, die es vor Unterspannung, Überladung, Kurzschluss und vor zu hoher Temperatur durch Abschaltung schützen. Weiter schaltet das Gerät ab, wenn der Feuerknopf länger als 10 Sekunden ohne Pause gedrückt wird.</p>
<h2><strong>Fazit</strong></h2>
<p>Die Aspire Nautilus AIO E-Zigarette ist ein hochwertiges Einsteiger-Gerät, das wir gern empfehlen. Es verwendet die beliebten Aspire BVC Verdampferköpfe, die mit einer exzellenten Geschmacksproduktion beeindrucken. Den Verdampferkopf wechseln zu können, ohne das gesamte Pod ersetzen zu müssen, ist ein sehr vernünftiges Konstruktionsdetail. So werden Ressourcen und auch der Geldbeutel geschont.&nbsp;</p>
