    'AS100Z2' => array(
        'icNumber' => 'AS100Z2',
        'number' => 'AS100Z2',
        'name' => 'Aspire - Zelos 2.0 - E-Zigarette',
        'commonName' => 'Zelos 2.0',
        'type' => 'E_CIGARETTE',
        'category' => 'E-ZIGARETTEN',
