        'flavorCategory' => null,
        'addlCategory' => '',
        'dosage' => '',
        'base' => null,
        'description' => '<p>Die Aspire Zelos 2.0 E-Zigarette besteht aus dem Aspire Zelos Akku und dem Aspire Nautilus 2S Verdampfer. Speziell in dieser Kombination ergibt sich aus dem klaren, schlanken Design das sehr schöne und gefällige Gesamtbild. Die Aspire Zelos 2.0 ist gut verarbeitet und ein echter Handschmeichler.</p>
<p>Während der Aspire Zelos sehr durch sein Äußeres besticht, ist der Aspire Nautilus 2S Verdampfer der Enkel einer Legende. Als Nachfolger des geschmacklich überragenden Aspire Nautilus 2, stammt er vom Aspire Nautilus ab, der seinerseits viele Jahre als einer der geschmacklich besten Verdampfer für den Mouth-To-Lung-Stil (MTL) galt. Bei diesem Stil zieht man wie bei einer Zigarette den Dampf zunächst in den Mund, setzt die E-Zigarette ab, und inhaliert dann den Dampf aus dem Mund in die Lunge. Der Aspire Nautilus 2S erweist sich seiner Ahnenreihe mehr als würdig.&nbsp;</p>
<h2><strong>Aspire Zelos Akku</strong></h2>
<p>Der Aspire Zelos hat ein schlankes Gehäuse aus Aluminium und liegt durch seine runde Form sehr gut in der Hand. Der Feuerknopf ist durch seine Position gut zu erreichen und hat einen angnehmen Druckpunkt. Der Aspire Zelos hat einen fest verbauten LiPo-Akku mit 2.500 mAh, womit man gut über den Tag kommt. Er wird mit einer variablem Leistung bis 50 Watt betrieben. Der Aspire Zelos Akku eignet sich für Verdampfer mit einem Durchmesser bis 22 mm.</p>
<p>Die Einstellung unterschiedlicher Modi erfolgt über ein an der Seite angebrachtes Display und zwei kleine Tasten (plus und minus). Im Display wird auch der Ladestatus des Akkus angezeigt. Zudem ist die Anzeige im Display "intelligent", d.h. sie wechselt je nachdem, in welcher Richtung Sie das Gerät neigen, die Ausrichtung, so dass es immer ablesbar bleibt. Durch gleichzeitiges Drücken der Plus- und Minus-Taste erreichen Sie das Menu, über das Sie den Betriebsmodus auswählen können.</p>
<p>Im Volt-Modus (VV, variable volt) kann die Spannung in 0,1 V Schritten von 0,5 bis 8 Volt eingestellt werden. Im Watt-Modus (VW, variable watt) kann die Leistung in 0,1 W Schritten von 1 bis 50 Watt eingestellt werden. Die TC-Modi sind für temperaturgeregeltes Dampfen, wobei die Modi TC-NI für Nickeldrähte, TC-TI für Titandrähte und TC-SS für Edelstahldrähte verfügbar sind. Im Bypass-Modus wird die Akkuspannung 1:1 ausgegeben, in diesem Modus wird die Leistung durch den verwendeten Verdampferkopf vorgegeben.&nbsp;</p>
<p>Einsteigern empfehlen wir, den Aspire Zelos im Watt-Modus (VW) zu betreiben. Bei Verdampferköpfen ist üblicherweise der zulässige Betriebsbereich in Watt angegeben. Finden Sie einfach in diesem Bereich den Punkt, der Ihnen am besten gefällt. Die Modi für das temperaturkontrollierte Dampfen sind in der Bedienung komplizierter und erfordern in gewissem Umfang Fachwissen.</p>
<p>Der Zelos wird über eine Micro-USB Buchse auf der Vorderseite geladen, der Ladestrom kann bis zu 1A betragen.</p>
<h2><strong>Aspire Nautilus 2S Verdampfer</strong></h2>
<p>Der im Lieferumfang enthaltene Verdampfer Nautilus 2S hat ein Tankvolumen von 2,6 ml. Die Befüllung des Nautilus 2S wurde im Verlgeich zu seinem Vorgänger wesentlich verbessert und vereinfacht. Um Liquid nachzufüllen, wird die Verschraubung des Deckels der Metallkuppel, der das Mundstück trägt, gelöst. Anschließend kann der Deckel zur Seite geschoben werden und eine Einfüllöffnung wird sichtbar. Diese ist ausreichend groß, um aus üblichen Liquidflachen den Tank bequem befüllen zu können. Anschließend den Deckel zurückschieben und wieder festschrauben. Im verschraubten Zustand ist es nicht möglich, den Deckel zu verschieben. Es ist also ausgeschlossen, dass sich der Tankdeckel versehentlich in der Hosen- oder Handtasche öffnet.</p>
<p>Der Aspire Nautilus 2S verwendet die gleichen Aspire BVC-Verdampferköpfe (Bottom Vertical Coil) wie sein Vorgänger. Diese verfügen über eine einzige Heizwendel, die senkrecht in den Kopf eingebaut ist. Umgeben ist die Heizwendel von einer porösen Keramik, die als Liquidspeicher dient. Anders als andere Speichermaterialen garantiert die Keramik einen sehr authentischen Geschmack gleich vom ersten Zug an.</p>
<p>Neben den Verdampferköpfen mit 0,7 Ohm, 1,6 Ohm und 1,8 Ohm für das MTL-Dampfen steht für den Nautilus 2S ein weiterer Verdampferkopf mit 0,4 Ohm zur Verfügung. Der 0,4 Ohm Verdampferkopf ermöglicht das Dampfen im Direct-Lung-Stil (DL), wobei der Dampf direkt - ohne Zwischenstopp im Mund - aus dem Verdampfer in die Lunge inhaliert wird. Die Dampfentwicklung bleibt zwar hinter der von Verdampfern, die speziell für den DL-Stil entwickelt wurden, zurück, ist aber für einen Hybriden, der beide Dampf-Stile ermöglicht, sehr ordentlich. Der Tank des Nautilus 2S muss leer sein, um den Verdampferkopf zu wechseln.</p>
<p>Der Aspire Nautilus 2S wird mit zwei Mundstücken (Drip Tips) ausgeliefert. Das längere Mundstück besteht aus Edelstahl, das kürzere aus Kunststoff. Die Geschmacksentwicklung ist mit dem kürzeren Mundstück etwas besser als mit dem langen Mundstück. Wir empfehlen dieses Mundstück für das Dampfen im MTL-Stil. Das längere Mundstück bietet sich für das größere Dampfvolumen im DL-Stil an.</p>
<p>Der über den unteren Ring verstellbare Luftstromregler ist stufenlos verstellbar. Dabei ist sowohl die großvolumige Öffnung der Luftzufuhr als auch die Regulierung über ein Raster von Belüftungsöffnungen vorgesehen. Möchten Sie Sie im DL-Stil mit dem 0,4 Ohm Verdampferkopf dampfen, so wählen Sie die großvolumige Öffnung nach Geschmack. Für den MTL-Stil wählen Sie die Einstellung über das Lochraster so, dass Ihnen der Widerstand, den Sie beim Ziehen spüren, am angenehmsten ist. Mit fast geschlossenem Luftstromregler können Sie einen Zugwiderstand einstellen, der recht genau dem einer Zigarette entspricht.</p>
<h2>Unsere Bewertung</h2>
<p>Die Aspire Zelos 2.0 E-Zigarette ist ein ausgesprochen schönes Gerät. Der Akku kann auch für andere Verdampfer als den Aspire Nautilus 2S verwendet werden, aber gerade die Kombination aus Zelos Akku und Nautilus 2S Verdampfer bringt das Design zum Strahlen. Der Aspire Nautilus 2S Verdampfer ist leicht zu befüllen und die Verriegelung des Füllmechanismus ist schlicht genial. So sicher verschließbar sind viele andere Geräte nicht. Die einfache Bedienung macht die Aspire Zelos 2.0 auch für Einsteiger zu einem sehr interessanten Gerät, denn vom Geschmack spielt dieses Gerät in der Oberliga.</p>
