<p>Die Nord AIO 22 E-Zigarette hat ein schlichtes und dabei sehr wertiges Design. Optisch und haptisch entsteht der Eindruck hoher Verarbeitungsqualität. Das einzige Bedienelement im Betrieb ist der diamantförmige Feuerknopf. Der Feuerknopf ist gut zu ertasten und hat einen präzisen Druckpunkt. Durch fünfmaliges Klicken schalten Sie das Gerät ein oder aus. Um beim Ziehen Dampf zu erzeugen, halten Sie den Feuerknopf gedrückt.</p>
<p><strong>Nord AIO 22 Verdampfer</strong></p>
<p>Der integrierte Tank der Nord AIO 22 E-Zigarette hat Platz für 3,5 Milliliter Liquid, das sich dank Top-Filling-System sehr leicht von oben in den Verdampfer einfüllen lässt. Geöffnet wird der Tank mit einem kleinen Entriegelungsknopf und dem Aufschieben des oberen Teils. Direkt darunter befindet sich die Einfüllöffnung für das E-Liquid, die großzügig ausgelegt ist und das Befüllen leicht macht, auch wenn Ihre Liquidflasche eine etwas breitere Einfüllspitze hat.</p>
