<p>Die Geschmacksentwicklung und auch die Dampfentwicklung der SMOK Nord AIO 22 sind für einen Stick mit 30 Watt Leistung außergewöhnlich gut. Zwar kann der Stick bezüglich der Dampfentwicklung mancher Verdampfer nicht mithalten, die speziell für Direct Lung mit hohen Wattzahlen jenseits der 60 ausgelegt sind, aber das Gerät erzeugt soviel Dampf, dass es eine echte Freude ist.&nbsp;</p>
