<p>Für die Luftzufuhr hat die SMOK Nord AIO 22 zwei Lufteinlässe mit jeweils drei Luftlöchern. Die Luftbeimischung (Air Flow) ist abhängig vom verwendeten Verdampferkopf. Sie ist beim Mesh Coil deutlich höher als beim Regular Coil eingestellt. Damit ist der Zugwiderstand des Mesh Coils deutlich geringer als beim Regular Coil.</p>
